import Header from './Components/Header';
import {Routes,Route} from 'react-router-dom'
import Home from './Components/Home';
import Footer from './Components/Footer';
import About from './Components/About';
import NotFound from './Components/NotFound';
import Terms from './Components/TC';
import './App.css';
import Blog from './Components/Blog';
import BlogAlgoTrading from './Components/BlogAlgoTrading';
import BlogEquities from './Components/BlogEquities';
import BlogStocks from './Components/BlogStocks';
import BlogAlgolab from './Components/BlogTrading';
import BlogBuildingAlgorithms from './Components/BlogBuildingAlgorithms'
import B1 from './Components/blog/b1';


function App() {
  return (
    <div className="App">
      <Header/>
      <Routes>

        <Route exact path='/' element={<Home/>}/>
        <Route exact path='/home' element={<Home/>}/>
        <Route exact path='/about' element={<About/>}/>
        <Route exact path='/terms-and-conditions' element={<Terms/>}/>
        <Route exact path='/blog' element={<Blog/>}/>
        <Route path='/blog/Intro-to-Stock-Markets' element={<BlogStocks/>}/>
        <Route path='/blog/Equities,-Futures-and-Options' element={<BlogEquities/>}/>
        <Route path='/blog/Trading-and-Investing' element={<BlogAlgoTrading/>}/>
        <Route exact path='/blog/Intro-to-Algo-trading' element={<BlogAlgoTrading/>}/>
        <Route path='/blog/Building-Algorithms' element={<BlogBuildingAlgorithms/>}/>

        <Route path='blog/Intro-to-Stock-Markets/What-is-stock-market' element={<B1/>}/>
        <Route path='*' element={<NotFound/>}/>
      </Routes>
      <Footer/>
    </div>
  );
}

export default App;
